import React, { Component } from "react";
import { FaInstagram } from "react-icons/fa";

class Button extends Component {
  state = {};
  render() {
    return (
      <a href="#">
        <FaInstagram style={{ width: 100, height: 100 }} />
      </a>
    );
  }
}

export default Button;
